INSERT INTO `report` VALUES (201,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',20,'재물운은 좋아보이지 않아. 하지만 당신의 노력과 인내심이 결실을 맺게 될거야.',200,NULL,NULL,NULL),(202,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',56,'현재 당신은 과거의 실수로 인해 돈 문제를 겪고 있어. 하지만 지금은 그 문제를 해결할 수 있는 기회가 찾아올거야.',200,NULL,NULL,NULL),(203,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',119,'돈을 많이 벌기 위해서는 현재의 행동과 선택에 대해 다시 생각해봐야 할 거야. 하지만 그 고민이 재물운에 좋은 영향을 끼칠 거야.',200,NULL,NULL,NULL),(204,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',152,'돈을 벌기 위해 지금 당장 노력하고 노력한 결과를 충분히 즐기는 것이 중요해. 미래에는 더욱 더 풍성한 보상이 있을 거야.',200,NULL,NULL,NULL),(205,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',95,'돈을 많이 벌기 위해서는 자신이 가진 재능과 능력을 활용해야 해. 하지만 현재는 자신의 능력을 과소평가하고 부족함을 느끼고 있어. 이에 대한 불안과 자책감 때문에 현재 상황에서는 돈을 벌기 어려울 거야. 하지만 이러한 부정적인 마음을 버리고 자신의 능력에 자신감을 가지면, 미래에는 풍요롭고 행복한 삶을 살 수 있을 거야.',200,NULL,NULL,NULL),(206,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',130,'현재 상황에서는 돈을 벌기 어려울 것 같아. 하지만 자신의 능력과 재능을 믿고 꾸준히 노력하면 언젠가는 부를 누릴 수 있을 거야. 현재의 어려움은 미래의 풍요로움을 위한 시련일 뿐이니까, 힘들어도 포기하지 말고 꾸준히 노력해봐.',200,NULL,NULL,NULL),(207,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',69,'돈을 많이 벌기 위해서는 현재의 상황에서 벗어나 새로운 시도를 해봐야 할 거야. 하지만 이에 대한 불안과 두려움이 있을 수 있어. 하지만 그 두려움을 극복하고 새로운 가능성을 찾는다면, 성공할 수 있을 거야.',200,NULL,NULL,NULL),(208,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',72,'재물운에서는 현재 상황이 만족스럽지 않은 것 같아. 하지만 이를 극복하기 위해서는 자신의 능력을 믿고 주변의 도움을 받아야 해. 조언이나 가르침을 받아들이며 성장해 나가면, 미래에는 풍요로운 삶을 살 수 있을 거야.',200,NULL,NULL,NULL),(209,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',90,'돈을 많이 벌기 위해서는 지금까지의 경험과 지식을 활용하여 새로운 도전을 해봐야 해. 하지만 조심해야 할 점은 인내심을 가지고 차분하게 계획을 세우는 것이 중요해.',200,NULL,NULL,NULL),(210,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',35,'미래에 돈을 많이 벌기 위해서는 현재의 상황에서 타협하지 말고 끊임없이 발전하고 성장하는 노력이 필요해. 그리고 자신의 능력을 믿고 도전하는 것이 좋아.',200,NULL,NULL,NULL),(211,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-15 17:54:35',10,'그대의 삶이 운명의 미소로 가득 차 있길!',200,NULL,NULL,NULL),(226,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-16 06:44:03',117,'두 마리의 토끼를 모두 잡으려다 놓쳐버리는 운이 있다네. 이익을 위해 스스로 평판을 낮추는 행위는 반드시 삼가시게나.',225,NULL,NULL,NULL),(227,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-16 06:44:03',72,'정신적으로 물질적으로도 행복할 수 있는 운이 있다네. 개인에게 소소한 보상을 하며 작은 행복들을 느껴보시게나.',225,NULL,NULL,NULL),(228,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-16 06:44:03',83,'지금까지 믿어온 것들에 배신당할 수 있다네. 달콤한 유혹에 넘어가면 반드시 화를 입으니 조심하시게나.',225,NULL,NULL,NULL),(229,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-16 06:44:03',15,'유혹이 많이 있으니 조심해야 하는 시기야. 여차하면 크게 다칠 수 있으니 꼭 조심하시게나.',225,NULL,NULL,NULL),(230,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-16 06:44:03',42,'포기하고 싶은 마음이 많이 들 수 있는 시기라네. 잠시 쉬면서 작은 변화를 준다면 극복할 수 있을 터이니 끝까지 힘내시게나.',225,NULL,NULL,NULL),(231,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-16 06:44:03',108,'지나치게 낙관적인 마음으로 현실을 바라보지 못할 수 있을 것이야. 우선순위를 정해 준비한 것을 모두 발휘할 수 있도록 노력해야 한다네.',225,NULL,NULL,NULL),(232,'9AXqZsNKSEY1YkRFqCOo7aT0Mre2','2023-05-16 06:44:03',20,'그대의 삶이 도약과 행운으로 가득 차 있길!',225,NULL,NULL,NULL),(234,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',120,'이번 뽑기에서는 좋은 결과가 나오기 어려울 거야.',233,NULL,NULL,NULL),(235,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',83,'재물 운이 좋지 않아서 현재 상황에서는 어려움이 있을 거야.',233,NULL,NULL,NULL),(236,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',134,'이번 뽑기에서는 좋은 결과가 나올 가능성이 적어보여.',233,NULL,NULL,NULL),(237,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',146,'재물운과 관련된 문제에서는 현재 어려움이 있지만, 조금씩 나아지고 있어.',233,NULL,NULL,NULL),(238,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',10,'이번 뽑기에서는 좋은 결과가 나올 가능성이 낮을 거야. 다만, 너의 노력이 결실을 맺을 때, 재물운이 좋아질 거야.',233,NULL,NULL,NULL),(239,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',118,'재물적인 문제로 어려움을 겪을 수 있어, 현재 상황을 다시 한번 체크하고 대처해야 해.',233,NULL,NULL,NULL),(240,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',113,'이번 뽑기에서는 좋은 결과가 나오기 어려울 거야. 7번째 카드인 Seven of Pentacles(Reverse)는 재물에 대한 불만족과 실패를 나타내고, 8번째 카드인 King of Wands(Reverse)는 결정력 부족과 비판적인 태도를 보여줘.',233,NULL,NULL,NULL),(241,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',85,'따라서 이번 뽑기에서는 성공하기 어려울 것이고, 실망할 가능성이 높아보여.',233,NULL,NULL,NULL),(242,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',48,'재물운은 좋지 않아. 9번째 카드는 미래에 대한 불확실성을 나타내고, 10번째 카드는 현재의 어려움을 나타내고 있어.',233,NULL,NULL,NULL),(243,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',124,'하지만 이 카드들은 당신이 노력하고 꾸준히 노력한다면 좋은 결과를 얻을 수 있다는 희망을 주고 있어.',233,NULL,NULL,NULL),(244,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:46:06',8,'그대의 삶이 용기와 힘으로 가득 차 있길!',233,NULL,NULL,NULL),(246,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:47:14',91,'망설이다 좋은 기회를 놓칠 수 있는 시기일세. 행여 이를 놓쳐 미련을 가진다면 더 큰 재앙이 올 것이니 이를 꼭 기억해야 한다네.',245,NULL,NULL,NULL),(247,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:47:14',110,'소문에 동요에 그릇된 판단을 내려서는 안 된다네. 기운이 넘치는 시기이니 서두르다 일을 그르치는 일이 없도록 하세.',245,NULL,NULL,NULL),(248,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:47:14',103,'현재에서 즐거움을 찾기 위해 노력하는 모습이 보인다네. 더 노력한다면 큰 즐거움이 올 것이니 자신을 잘 다독이며 앞으로 정진해야 할 것이야.',245,NULL,NULL,NULL),(249,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:47:14',136,'사람을 의심하고 이에 따라 남에게 해를 가할 수도 있다네. 과도한 생각으로 인해 생긴 오해일 수 있으니 건설적인 대화로 이를 잘 풀어가야 할 것이야.',245,NULL,NULL,NULL),(250,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:47:14',56,'중요한 것을 잃을 수 있는 시기라네. 이를 지키고자 부정을 저지르면 더 큰 화를 불러일으킬 것이니 조심해야 한다네.',245,NULL,NULL,NULL),(251,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:47:14',10,'직감을 믿되 순리에 맡기며 진행해야 한다네. 좋은 기회가 올 수 있으니 망설이지 말고 잡으시게나.',245,NULL,NULL,NULL),(252,'KHyLPyMOi9WnZI08JvOw9CaXdyG3','2023-05-16 14:47:14',7,'그대의 삶이 승리와 성공으로 가득 차 있길!',245,NULL,NULL,NULL),(254,'2787108773','2023-05-16 15:24:28',151,'권태가 생겨 무슨 일하더라도 지루할 수 있겠네. 현실에서 억지를 부리지 말고 새로운 변화를 맞이하는 것이 좋아 보인다네.',253,NULL,NULL,NULL),(255,'2787108773','2023-05-16 15:24:28',106,'타인의 방해로 기운을 소모할 수 있겠네. 피할 수 없는 충동이 아닌 이상 이를 피하는 지혜가 필요할 걸세.',253,NULL,NULL,NULL),(256,'2787108773','2023-05-16 15:24:28',75,'늘 생각하던 좋은 일들이 일어날 수 있겠네. 꿈이 넘치고 기쁨이 가득한 시기이니 소중한 사람들과 함께 나누는 것도 좋을 것이야.',253,NULL,NULL,NULL),(257,'2787108773','2023-05-16 15:24:28',91,'망설이다 좋은 기회를 놓칠 수 있는 시기일세. 행여 이를 놓쳐 미련을 가진다면 더 큰 재앙이 올 것이니 이를 꼭 기억해야 한다네.',253,NULL,NULL,NULL),(258,'2787108773','2023-05-16 15:24:28',27,'해오던 일이 있다면 좋은 성과로 마무리될 수 있을 거세. 또는 자네가 있는 곳에 좋은 사람이 들어올 수도 있을 것이야. ',253,NULL,NULL,NULL),(259,'2787108773','2023-05-16 15:24:28',37,'좋아하는 일이 생길 수 있을 거야. 배려하는 마음을 가지며 순간순간을 소중히 여기시게.',253,NULL,NULL,NULL),(260,'2787108773','2023-05-16 15:24:28',134,'기운이 좋지 않으나 남들의 도움을 받아 무사히 극복할 수 있는 운이 있다네. 하지만 모험보다는 안전한 길을 택해 최대한 사건을 피해야 할걸세.',253,NULL,NULL,NULL),(261,'2787108773','2023-05-16 15:24:28',84,'본인의 즐거움을 위해 남들을 고통스럽게 만들 수 있겠네. 주변을 살펴 가며 즉흥적인 행동을 삼가야 할 것이야.',253,NULL,NULL,NULL),(262,'2787108773','2023-05-16 15:24:28',121,'방해 요소가 많아 일에 실패할 수 있는 시기라네. 한 번에 한 가지 일에만 집중하며 시간을 잘 분배해서 사용해야 할 것이야.',253,NULL,NULL,NULL),(263,'2787108773','2023-05-16 15:24:28',154,'남에게 정신적 도움을 주더라도 물질적인 도움을 줘서는 안 된다네. 이 시기에 꾐에 넘어가 다칠 수 있으니 조심하시게나.',253,NULL,NULL,NULL),(264,'2787108773','2023-05-16 15:24:28',131,'활력이 넘치니 새로운 목표를 향해 나가기 좋은 시기일세. 귀찮음에 아무것도 하지 않으면 스스로 몰락할 수 있으니 주의하시게나.',253,NULL,NULL,NULL),(265,'2787108773','2023-05-16 15:24:28',95,'이상과 현실 사이에서 많이 고민할 수 있겠네. 부정적인 것 보단 아름다운 것에 주목하며 실현할 수 있는 꿈을 먼저 그려 나가보시게나.',253,NULL,NULL,NULL),(266,'2787108773','2023-05-16 15:24:28',20,'그대의 삶이 도약과 행운으로 가득 차 있길!',253,NULL,NULL,NULL),(382,'2785185456','2023-05-17 15:20:52',125,'지키고자 하는 마음에 섣불리 나가지 못하는 때라네. 용기를 내서 도전하면 분명 좋은 성과가 있을 것이니 두려워하지 마시게나.',381,NULL,NULL,NULL),(383,'2785185456','2023-05-17 15:20:52',150,'쾌락에 빠져 무슨 일을 해도 공허할 수 있을 것이네. 특히 금전적인 문제가 생길 수 있으니 돈과 관련 없는 일들에 관심을 가지는 것도 중요해 보인다네.',381,NULL,NULL,NULL),(384,'2785185456','2023-05-17 15:20:52',88,'말실수로 인해 큰 화를 입을 수 있으니 조심할 필요가 있다네. 앞서 행동하기보단 뒤에서 운명의 흐름에 자신을 맡기는 것도 현명한 선택이 될 것이야.',381,NULL,NULL,NULL),(385,'2785185456','2023-05-17 15:20:52',56,'중요한 것을 잃을 수 있는 시기라네. 이를 지키고자 부정을 저지르면 더 큰 화를 불러일으킬 것이니 조심해야 한다네.',381,NULL,NULL,NULL),(386,'2785185456','2023-05-17 15:20:52',0,'새로운 일을 시작하기에 좋은 시기야. 가벼운 마음으로 도전해보시게',381,NULL,NULL,NULL),(387,'2785185456','2023-05-17 15:20:52',7,'바쁘겠지만 그만큼 힘이 넘칠 시기라네. 용기를 가지고 도전한다면 좋은 성과를 이룰 수 있을 것이야.',381,NULL,NULL,NULL),(388,'2785185456','2023-05-17 15:20:52',1,'그대의 삶이 기술과 창조력으로 가득 차 있길!',381,NULL,NULL,NULL),(418,'2787108773','2023-05-17 17:06:14',9,'재물운과 관련된 카드가 없어서 정확한 결과를 보장할 수 없어.',417,NULL,NULL,NULL),(419,'2787108773','2023-05-17 17:06:14',14,'하지만 The Hermit 카드가 나왔는데, 이는 혼자서 노력하고 탐구하여 성취를 이룰 수 있다는 것을 말해주고 있어. 따라서 복권에 당첨되기 위해서는 노력과 탐구가 필요할 거야.',417,NULL,NULL,NULL),(420,'2787108773','2023-05-17 17:06:14',106,'재물운은 좋지 않아. 이번에는 복권에 당첨될 가능성이 낮을 거야.',417,NULL,NULL,NULL),(421,'2787108773','2023-05-17 17:06:14',40,'하지만 너의 노력과 인내심이 결실을 맺을 거야. 미래에는 재물운이 좋아질 거야.',417,NULL,NULL,NULL),(422,'2787108773','2023-05-17 17:06:14',68,'재물운은 좋지 않아. 돈에 관련된 문제로 고통받을 수도 있어.',417,NULL,NULL,NULL),(423,'2787108773','2023-05-17 17:06:14',100,'어떤 변화가 생기더라도 긍정적으로 받아들이고 적극적으로 대처해야 해.',417,NULL,NULL,NULL),(424,'2787108773','2023-05-17 17:06:14',32,'재물운과 관련된 결과는 별로 좋지 않아. 7번째 카드인 Page of Wands는 새로운 기회를 제공하지만, Ace of Wands(Reverse) 카드와 함께 복권에 대한 투자는 손해를 볼 가능성이 높아.',417,NULL,NULL,NULL),(425,'2787108773','2023-05-17 17:06:14',79,'8번째 카드인 The Magician(Reverse)는 손재주가 좋지 않은 상태를 나타내고, 복권에 대한 선택이 혼란스러울 수 있어.',417,NULL,NULL,NULL),(426,'2787108773','2023-05-17 17:06:14',48,'재물운에 대해서는 The Hermit 카드가 나왔는데, 현재는 조용한 시간이 필요한 상황이야. 복권에 대해서는 결과는 나오지 않았어.',417,NULL,NULL,NULL),(427,'2787108773','2023-05-17 17:06:14',127,'10번째 카드인 Queen of Pentacles 카드는 재물적인 안정과 풍요로움을 상징해. 하지만 복권에 대한 구체적인 결과는 알 수 없어.',417,NULL,NULL,NULL),(428,'2787108773','2023-05-17 17:06:14',19,'그대의 삶이 따뜻한 빛과 기쁨으로 가득 차 있길!',417,NULL,NULL,NULL),(442,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-17 17:46:00',1,'원하던 것이 있다면 꼭 이룰 수 있을 거세. 자신감을 가지고 앞서 나가보시게나.',441,NULL,NULL,NULL),(443,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-17 17:46:00',129,'문제의 본질을 모른 채 행동하다 큰 화를 입을 수 있다네. 시야가 좁아지고 주위에 간신배가 생길 수 있으니 특히 더 조심해야 할 것이야.',441,NULL,NULL,NULL),(444,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-17 17:46:00',144,'맺고 끊음이 없으니 다시 시작점으로 돌아가는 운이 있다네. 마음먹은 일이 있다면 집중하여 앞으로 가야 할 것이야.',441,NULL,NULL,NULL),(445,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-17 17:46:00',59,'고통스러운 일들이 정리되고 한단계 성장할 수 있는 운이 있다네. 상황이 더는 나빠지지 않을 터이니 심기일전하여 이겨내시게나.',441,NULL,NULL,NULL),(446,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-17 17:46:00',128,'무리한 행동으로 일을 그르칠 수 있다네. 한발 물러서서 지금까지 한 행동들을 헛되이 하지 마시게나.',441,NULL,NULL,NULL),(447,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-17 17:46:00',150,'쾌락에 빠져 무슨 일을 해도 공허할 수 있을 것이네. 특히 금전적인 문제가 생길 수 있으니 돈과 관련 없는 일들에 관심을 가지는 것도 중요해 보인다네.',441,NULL,NULL,NULL),(448,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-17 17:46:00',14,'그대의 삶이 조화와 균형으로 가득 차 있길!',441,NULL,NULL,NULL),(450,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-17 23:31:19',78,'기회는 있으나 혼자 행동해 놓칠 수 있다네. 자신을 속이며 현실을 피하는 일은 없어야 할걸세.',449,NULL,NULL,NULL),(451,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-17 23:31:19',30,'많은 일들이 일어날 수 있는 시기일세. 준비를 잘 해둔다면 쉽게 넘어갈 수 있는 운이 함께 있으니 꼭 기억하시게나.',449,NULL,NULL,NULL),(452,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-17 23:31:19',33,'새로운 일을 하고 싶은 욕구가 생길 수도 있는 시기야. 즉흥 여행을 떠나 이러한 욕구를 푸는 것도 좋을 거세.',449,NULL,NULL,NULL),(453,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-17 23:31:19',94,'안 좋은 일들이 많이 발생할 수 있는 시기라네. 고통이 더 심해지겠지만 좋은 운을 만날 때까지 고생할 운명이니 마음을 단단히 먹으시게나.',449,NULL,NULL,NULL),(454,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-17 23:31:19',116,'실력은 있지만 이를 인정받지 못하는 시기라네. 형식에 얽매이지 말고 꼼꼼하게 확인하는 태도가 필요할 걸세.',449,NULL,NULL,NULL),(455,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-17 23:31:19',67,'현재 상황에 대해 많은 의심을 가질 수 있는 시기라네. 곁에 누군가 있다면 더욱 힘들 수 있으니 혼자만의 시간을 보내는 것이 좋아 보인다네.',449,NULL,NULL,NULL),(456,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-17 23:31:19',6,'그대의 삶이 사랑과 즐거움으로 가득 차 있길!',449,NULL,NULL,NULL),(458,'2785185456','2023-05-17 23:47:33',29,'면접 결과는 좋지 않을거야.',457,NULL,NULL,NULL),(459,'2785185456','2023-05-17 23:47:33',10,'어려움과 실패가 예상돼.',457,NULL,NULL,NULL),(460,'2785185456','2023-05-17 23:47:33',98,'지난 면접 결과는 좋은 결과가 아니었을거야.',457,NULL,NULL,NULL),(461,'2785185456','2023-05-17 23:47:33',121,'그러나 너의 열심힘과 노력으로 인해 더 나은 결과를 얻을 수 있을거야.',457,NULL,NULL,NULL),(462,'2785185456','2023-05-17 23:47:33',72,'면접 결과는 아직 불확실해보이는군.',457,NULL,NULL,NULL),(463,'2785185456','2023-05-17 23:47:33',109,'하지만 노력하고 계속 노력한다면 좋은 결과를 얻을 수 있을거야.',457,NULL,NULL,NULL),(464,'2785185456','2023-05-17 23:47:33',