LL,NULL,NULL),(484,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',72,'정신적으로 물질적으로도 행복할 수 있는 운이 있다네. 개인에게 소소한 보상을 하며 작은 행복들을 느껴보시게나.',481,NULL,NULL,NULL),(485,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',27,'해오던 일이 있다면 좋은 성과로 마무리될 수 있을 거세. 또는 자네가 있는 곳에 좋은 사람이 들어올 수도 있을 것이야. ',481,NULL,NULL,NULL),(486,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',66,'원하던 것을 손에 넣으며 마음속 응어리가 풀릴 거세. 어려운 일이 있다면 친구들과 함께 놀며 기분 전환을 해보는 것도 좋을 것이야.',481,NULL,NULL,NULL),(487,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',151,'권태가 생겨 무슨 일하더라도 지루할 수 있겠네. 현실에서 억지를 부리지 말고 새로운 변화를 맞이하는 것이 좋아 보인다네.',481,NULL,NULL,NULL),(488,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',19,'즐기기만 해도 성공이 따라오는 좋은 시기야. 행운이 나에게 있다고 생각하며 원하던 그림을 완성해 나가시게나.',481,NULL,NULL,NULL),(489,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',112,'남을 배려하며 억지를 부리지 않아야 화를 피할 수 있는 시기라네. 특히 이 시기에 생기는 질투심은 큰 독이니 조심하시게나.',481,NULL,NULL,NULL),(490,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',60,'나쁜 일이 오지는 않나 긴장감이 계속 있는 시기라네. 마음에 걸리는 일들이 있다면 조심스럽게 대비를 해두는 것이 좋을 것이야.',481,NULL,NULL,NULL),(491,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',155,'큰 이득을 위해서 작은 손해는 감수하는 자세가 필요하다네. 편한 길만 생각하다간 모든 걸 그르칠 수 있으니 자신을 속이는 일은 없어야 할 것이야.',481,NULL,NULL,NULL),(492,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',102,'모든 준비는 끝났으나 망설임에 나아가지 못하는 시기라네. 초조해하지 말고 차분하게 나아가 좋은 시기를 놓치지 말게나.',481,NULL,NULL,NULL),(493,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',70,'유혹에 빠져 스스로 화를 불러일으킬 수 있는 시기야. 자신에게 빠져 비극을 쓰는 일이 없도록 주의하시게나.',481,NULL,NULL,NULL),(494,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 00:49:46',13,'그대의 삶이 새 생명의 기운으로 가득 차 있길!',481,NULL,NULL,NULL),(496,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:16:01',130,'알고 싶지 않은 사실을 알게 되어 마음고생을 심하게 할 수 있는 시기라네. 무엇이든 받아드리기 나름이라는 생각을 가지고 잘 추스르길 바라네.',495,NULL,NULL,NULL),(497,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:16:01',12,'어려운 일들이 생기더라도 이를 받아드리고 기다려야 할 거야. 차분하게 생각한다면 빛을 볼 수 있을 테니 침착하게 행동하시게.',495,NULL,NULL,NULL),(498,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:16:01',10,'직감을 믿되 순리에 맡기며 진행해야 한다네. 좋은 기회가 올 수 있으니 망설이지 말고 잡으시게나.',495,NULL,NULL,NULL),(499,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:16:01',116,'실력은 있지만 이를 인정받지 못하는 시기라네. 형식에 얽매이지 말고 꼼꼼하게 확인하는 태도가 필요할 걸세.',495,NULL,NULL,NULL),(500,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:16:01',66,'원하던 것을 손에 넣으며 마음속 응어리가 풀릴 거세. 어려운 일이 있다면 친구들과 함께 놀며 기분 전환을 해보는 것도 좋을 것이야.',495,NULL,NULL,NULL),(501,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:16:01',113,'의욕은 앞서나 이것이 오히려 자네에게 독이 될 수 있다네. 계획을 잘 세워 위험을 피할 방안들을 미리 준비해야 할걸세.',495,NULL,NULL,NULL),(502,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:16:01',0,'그대의 삶이 자유롭고 모험으로 가득 차 있길!',495,NULL,NULL,NULL),(504,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',12,'어려운 일들이 생기더라도 이를 받아드리고 기다려야 할 거야. 차분하게 생각한다면 빛을 볼 수 있을 테니 침착하게 행동하시게.',503,NULL,NULL,NULL),(505,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',146,'일이 어려워 보이지만 그 해답을 찾을 수 있는 운이 있다네. 두려워하지 말고 조금 더 노력해보시게나.',503,NULL,NULL,NULL),(506,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',6,'좋은 일들이 가득한 시기가 될 거야. 타인의 시선을 의식하지 말고 이를 즐겨보길 바라네.',503,NULL,NULL,NULL),(507,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',129,'문제의 본질을 모른 채 행동하다 큰 화를 입을 수 있다네. 시야가 좁아지고 주위에 간신배가 생길 수 있으니 특히 더 조심해야 할 것이야.',503,NULL,NULL,NULL),(508,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',121,'방해 요소가 많아 일에 실패할 수 있는 시기라네. 한 번에 한 가지 일에만 집중하며 시간을 잘 분배해서 사용해야 할 것이야.',503,NULL,NULL,NULL),(509,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',153,'원하는 것을 손에 넣었으나 불안할 수 있다네. 자네를 유혹하는 것들이 많아질 시기이니 불필요한 인연은 과감하게 끊어야 할 것이네.',503,NULL,NULL,NULL),(510,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',20,'과거에 해왔던 일들을 다시 한번 정리하기 좋은 시기라네. 지금 하는 일들에 대한 열쇠를 얻을 수 있을 것이야.',503,NULL,NULL,NULL),(511,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',32,'좋은 소식이나 기회가 찾아올 운이 있다네. 눈앞에 있는 것에 집중하며 불필요한 것은 생각하지 말게나.',503,NULL,NULL,NULL),(512,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',31,'잔걱정이 많아질 수 있는 시기라네. 주변 사람들에게 도움을 구해가며 그 짐을 덜 수 있도록 해야 할 것이야.',503,NULL,NULL,NULL),(513,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',71,'과거에서 벗어나 새로움을 향해 나아가기 좋은 시기라네. 무거운 짐을 내려놓으며 과거 일을 되돌아보는 것도 좋을 거세.',503,NULL,NULL,NULL),(514,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',25,'고민을 접어두고 휴식을 취하는 것이 좋을 것이야. 또는 주변에 좋은 일이 있을 수 있으니 이를 축하해주는 것도 좋을 거세.',503,NULL,NULL,NULL),(515,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',155,'큰 이득을 위해서 작은 손해는 감수하는 자세가 필요하다네. 편한 길만 생각하다간 모든 걸 그르칠 수 있으니 자신을 속이는 일은 없어야 할 것이야.',503,NULL,NULL,NULL),(516,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 01:22:35',11,'그대의 삶이 화합과 정의로 가득 차 있길!',503,NULL,NULL,NULL),(530,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',112,'이번 프로젝트는 강한 의지와 열정이 필요한 상황이야. 하지만 너무 과도한 열정은 오히려 역효과를 낼거야. 조심스럽게 계획을 세우고 꾸준한 노력으로 성공할 수 있을 거야.',529,NULL,NULL,NULL),(531,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',119,'현재 상황에서는 불안정한 상태이며, 다양한 선택지와 유혹이 너를 동시에 유혹하고 있어. 이러한 상황에서는 꾸준한 노력과 인내가 필요해. 끈기와 인내로 이겨낸다면 좋은 결과를 얻을 수 있을 거야.',529,NULL,NULL,NULL),(532,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',32,'프로젝트가 성공할 가능성은 낮아보여.',529,NULL,NULL,NULL),(533,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',14,'하지만 당신의 노력과 인내심이 성공을 이루는데 큰 역할을 할거야.',529,NULL,NULL,NULL),(534,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',85,'이번 프로젝트는 성공할 가능성이 낮아.',529,NULL,NULL,NULL),(535,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',120,'하지만 실패하지 않을 만큼의 노력과 인내심을 가지고 있으면 성공할 수 있어.',529,NULL,NULL,NULL),(536,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',93,'이번 프로젝트는 성공할 가능성이 적어.',529,NULL,NULL,NULL),(537,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',128,'하지만, 실패를 막기 위해 노력하면 성공할 수 있을거야.',529,NULL,NULL,NULL),(538,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',33,'이번 프로젝트는 성공할 가능성이 낮아.',529,NULL,NULL,NULL),(539,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',1,'하지만 포기하지 말고 노력하면 성공할 수 있어.',529,NULL,NULL,NULL),(540,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 02:05:58',12,'그대의 삶이 평안과 새로움으로 가득 차 있길!',529,NULL,NULL,NULL),(542,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 03:01:58',150,'쾌락에 빠져 무슨 일을 해도 공허할 수 있을 것이네. 특히 금전적인 문제가 생길 수 있으니 돈과 관련 없는 일들에 관심을 가지는 것도 중요해 보인다네.',541,NULL,NULL,NULL),(543,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 03:01:58',120,'무작정 일하며 스스로 열의나 노력이 부족하다고 생각할 수 있을 것이야. 새로운 방법으로 재도전하거나 실패에서 배우는 자세가 필요할 것이라네.',541,NULL,NULL,NULL),(544,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 03:01:58',78,'기회는 있으나 혼자 행동해 놓칠 수 있다네. 자신을 속이며 현실을 피하는 일은 없어야 할걸세.',541,NULL,NULL,NULL),(545,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 03:01:58',1,'원하던 것이 있다면 꼭 이룰 수 있을 거세. 자신감을 가지고 앞서 나가보시게나.',541,NULL,NULL,NULL),(546,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 03:01:58',102,'모든 준비는 끝났으나 망설임에 나아가지 못하는 시기라네. 초조해하지 말고 차분하게 나아가 좋은 시기를 놓치지 말게나.',541,NULL,NULL,NULL),(547,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 03:01:58',148,'꿈을 현실로 만들기에 적절한 기운이 있다네. 망설이지 말고 결심했던 것들을 과감하게 실행해보시게나.',541,NULL,NULL,NULL),(548,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 03:01:58',20,'그대의 삶이 도약과 행운으로 가득 차 있길!',541,NULL,NULL,NULL),(550,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:35:52',17,'재능이나 실력을 인정받을 수 있는 좋은 기회가 있다네. 희망을 가지고 스스로를 믿으며 긍정적으로 지내시게나.',549,NULL,NULL,NULL),(551,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:35:52',98,'이미 놓친 기회가 있다면 이는 다시 오지 않을 것이니 미련을 가져서는 안 된다네. 미루고 있던 것과 마주하며 꼭 필요한 기회는 잡을 수 있도록 해야 할 거세.',549,NULL,NULL,NULL),(552,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:35:52',0,'새로운 일을 시작하기에 좋은 시기야. 가벼운 마음으로 도전해보시게',549,NULL,NULL,NULL),(553,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:35:52',61,'이성적으로 판단하여 새로운 준비를 하기에 좋은 시기라네. 불필요한 낭비를 통해 이를 운을 지켜야 할 것이야.',549,NULL,NULL,NULL),(554,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:35:52',82,'마음에 여유가 없으니 지금의 자리에서 내려올 수 있다네. 남들을 챙기며 독단적인 행동을 삼가야 그 화를 면할 수 있을 걸세.',549,NULL,NULL,NULL),(555,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:35:52',150,'쾌락에 빠져 무슨 일을 해도 공허할 수 있을 것이네. 특히 금전적인 문제가 생길 수 있으니 돈과 관련 없는 일들에 관심을 가지는 것도 중요해 보인다네.',549,NULL,NULL,NULL),(556,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:35:52',14,'그대의 삶이 조화와 균형으로 가득 차 있길!',549,NULL,NULL,NULL),(558,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',149,'당신은 현재 자신의 능력과 자원을 충분히 활용하지 못하고 있어. 그러나 끈기와 인내력을 가지고 노력하면 성공할 수 있을 거야.',557,NULL,NULL,NULL),(559,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',86,'당신은 자신의 내면에서 영감을 받아야 해. 또한 자신만의 독창적인 방법으로 문제를 해결하는 능력을 가지고 있어. 이를 활용하면 원하는 성공을 얻을 수 있을 거야.',557,NULL,NULL,NULL),(560,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',7,'당신은 현재 자신의 능력을 과소평가하고 있어. 하지만 지금 당장 노력하고 끈기를 가지면 성공할 수 있어.',557,NULL,NULL,NULL),(561,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',150,'이전에 실패한 경험이 있어 자신감이 부족해 보일지도 모르지만, 당신은 강인한 의지력을 가지고 있어 이번에는 성공할 수 있어.',557,NULL,NULL,NULL),(562,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',62,'Eight of Cups(Reverse)',557,NULL,NULL,NULL),(563,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',134,'Strength(Reverse)\n너는 지금 자신의 내면에 대한 탐색을 멈추고 현재의 상황에서 더욱 집중해야 해. 그리고 내면의 힘을 발휘해서 어려움을 극복해 나가야 해.',557,NULL,NULL,NULL),(564,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',10,'Eight of Cups(Reverse)는 지금 당장 성공하기에는 적절하지 않은 시기이고, Strength(Reverse)는 자신감 부족으로 인해 성공을 방해하는 상황일 거야.',557,NULL,NULL,NULL),(565,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',22,'하지만 Wheel of Fortune는 운이 좋아져 성공할 가능성이 높아지고, Ace of Wands는 새로운 아이디어나 열정적인 태도로 성공할 수 있음을 암시해.',557,NULL,NULL,NULL),(566,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',37,'Eight of Cups(Reverse)는 지금 당장 성공하기에는 적절하지 않은 시기이고, Strength(Reverse)는 자신감 부족으로 인해 성공을 방해하는 상황일 거야.',557,NULL,NULL,NULL),(567,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',63,'하지만 Wheel of Fortune는 운이 좋아져 성공할 가능성이 높아지고, Ace of Wands는 새로운 아이디어나 열정적인 태도로 성공할 수 있음을 암시해.',557,NULL,NULL,NULL),(568,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 04:41:44',15,'그대의 삶이 타오르는 열정으로 가득 차 있길!',557,NULL,NULL,NULL),(570,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 09:00:41',4,'하던 일이 있다면 인정받을 수 있는 시기일세. 당당하게 행동하며 확실하게 행동하시게나.',569,NULL,NULL,NULL),(571,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 09:00:41',15,'유혹이 많이 있으니 조심해야 하는 시기야. 여차하면 크게 다칠 수 있으니 꼭 조심하시게나.',569,NULL,NULL,NULL),(572,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 09:00:41',119,'돈으로 사람을 움직이게 하기 위해 애쓰는 모습이 보인다네. 과시를 위해 불필요한 낭비를 삼가는 것이 중요할 것이야.',569,NULL,NULL,NULL),(573,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 09:00:41',132,'생각하지 못한 일들에 화를 당할 수 있겠네. 한발 뒤에서 계획을 되돌아보며 손실에 대비하는 것이 많은 도움이 될걸세.',569,NULL,NULL,NULL),(574,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 09:00:41',126,'헤픈 씀씀이로 고생을 할 수 있다네. 남들을 돕는 것은 좋으나 자네의 현실에 맞게끔 하는 것이 중요할 것이야.',569,NULL,NULL,NULL),(575,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 09:00:41',91,'망설이다 좋은 기회를 놓칠 수 있는 시기일세. 행여 이를 놓쳐 미련을 가진다면 더 큰 재앙이 올 것이니 이를 꼭 기억해야 한다네.',569,NULL,NULL,NULL),(576,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 09:00:41',4,'그대의 삶이 리더십과 안정으로 가득 차 있길!',569,NULL,NULL,NULL),(578,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 10:02:48',40,'사랑운에 대해 별다른 징조는 없어.',577,NULL,NULL,NULL),(579,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 10:02:48',45,'하지만 이 사람과의 관계가 장기적으로 안정적이고 행복한 결과를 가져올 가능성이 높아.',577,NULL,NULL,NULL),(580,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 10:02:48',25,'사랑운이 좋지 않아. 돈 문제나 가정 문제 때문에 서로 갈등을 느끼고 있을 거야. 이 문제를 해결하려면 서로의 관점을 바꾸고 희생을 감수해야 할 거야.',577,NULL,NULL,NULL),(581,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 10:02:48',114,'하지만 이 문제를 극복하면 매우 행복한 가정을 이룰 수 있을 거야. 서로를 도와주고 지지해줄 준비가 되어있어야 해.',577,NULL,NULL,NULL),(582,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 10:02:48',100,'사랑운이 별로 좋지 않아. 불안정한 상황과 결핍감이 느껴질거야. 하지만 이것이 영원한 것은 아니니까 참고 견디면서 기다려봐.',577,NULL,NULL,NULL),(583,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 10:02:48',48,'새로운 사랑이나 열정적인 만남이 있을 수 있어. 하지만 그것이 지속되기 위해서는 자신의 열정과 의지가 필요해.',577,NULL,NULL,NULL),(584,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 10:02:48',89,'사랑운은 지금 혼란스러울 수 있어. 하지만 정의를 찾을 수 있다면, 행복한 가정을 이룰 수 있을 거야.',577,NULL,NULL,NULL),(585,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 10:02:48',18,'당신의 열정과 행동력이 부족해 사랑운이 좋지 않아. 하지만 지금은 그냥 조용히 지내는 게 좋을 거야.',577,NULL,NULL,NULL),(586,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 10:02:48',111,'사랑운이 좋지 않아. 과거의 상처와 불안이 현재의 관계에 영향을 미치고 있어. 하지만 이 문제를 해결하면 행복한 결말이 기다리고 있어.',577,NULL,NULL,NULL),(587,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 10:02:48',47,'당신이 현재 가지고 있