2023-05-18 13:48:23',104,'발전이 있는 경쟁이 아닌 퇴보를 위한 투쟁을 할 수 있겠네. 좋지 않은 상황이라면 길게 끌고 가서는 안 될 걸세.',619,NULL,NULL,NULL),(623,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 13:48:23',37,'좋아하는 일이 생길 수 있을 거야. 배려하는 마음을 가지며 순간순간을 소중히 여기시게.',619,NULL,NULL,NULL),(624,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 13:48:23',76,'평소보다 감각이 조금 더 예민하다 느낄 수 있다네. 이 시기 주변 환경을 좀 더 파악할 수 있는 통찰력이 생겨 그런 것이니 너무 두려워하지는 말게나.',619,NULL,NULL,NULL),(625,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 13:48:23',103,'현재에서 즐거움을 찾기 위해 노력하는 모습이 보인다네. 더 노력한다면 큰 즐거움이 올 것이니 자신을 잘 다독이며 앞으로 정진해야 할 것이야.',619,NULL,NULL,NULL),(626,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 13:48:23',152,'어린아이처럼 응석을 부리다간 달콤한 유혹에 넘어가 화를 입을 수 있다네. 의존하는 관계가 있다면 반드시 끊어야 그 화를 면할 수 있을 것이야.',619,NULL,NULL,NULL),(627,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 13:48:23',71,'과거에서 벗어나 새로움을 향해 나아가기 좋은 시기라네. 무거운 짐을 내려놓으며 과거 일을 되돌아보는 것도 좋을 거세.',619,NULL,NULL,NULL),(628,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 13:48:23',53,'일상에 지쳐 매우 힘들 수 있는 시기일세. 충분히 휴식을 취하지 못한다면 잠이라도 꼭 잘 자야 화를 피할 수 있을 거세.',619,NULL,NULL,NULL),(629,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 13:48:23',88,'말실수로 인해 큰 화를 입을 수 있으니 조심할 필요가 있다네. 앞서 행동하기보단 뒤에서 운명의 흐름에 자신을 맡기는 것도 현명한 선택이 될 것이야.',619,NULL,NULL,NULL),(630,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 13:48:23',13,'고민되는 일이 있다면 과감하게 정리해야 복이 들어오는 시기라네. 변화가 많을 수 있으니 마음의 준비를 잘하는 것도 좋아 보인다네.',619,NULL,NULL,NULL),(631,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 13:48:23',56,'중요한 것을 잃을 수 있는 시기라네. 이를 지키고자 부정을 저지르면 더 큰 화를 불러일으킬 것이니 조심해야 한다네.',619,NULL,NULL,NULL),(632,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 13:48:23',21,'그대의 삶이 성취의 달콤함으로 가득 차 있길!',619,NULL,NULL,NULL),(634,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 14:01:25',74,'자신에게 솔직해지고 타인에게 친절해져야 한다네. 모든 것을 받아들이는 마음이 더 중요한 시기가 될걸세.',633,NULL,NULL,NULL),(635,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 14:01:25',1,'원하던 것이 있다면 꼭 이룰 수 있을 거세. 자신감을 가지고 앞서 나가보시게나.',633,NULL,NULL,NULL),(636,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 14:01:25',148,'꿈을 현실로 만들기에 적절한 기운이 있다네. 망설이지 말고 결심했던 것들을 과감하게 실행해보시게나.',633,NULL,NULL,NULL),(637,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 14:01:25',68,'헛된 희망에 매달려 일을 그르칠 수 있을 것이야. 냉정하게 행동하며 사소한 것까지 잘 챙겨야 할걸세.',633,NULL,NULL,NULL),(638,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 14:01:25',149,'그동안의 실패가 이제 성공을 향한 열쇠로 전환되는 시기라네. 좋은 기회가 많이 있을 것이니 새로운 마음으로 도전해보시게.',633,NULL,NULL,NULL),(639,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 14:01:25',133,'빛을 보고 싶지만 결국 다시 어둠이 오는 시기라네. 하지만 피한다면 아무것도 변하지 않을 것이니 각오를 다잡고 부지런히 나아가시게나.',633,NULL,NULL,NULL),(640,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-18 14:01:25',13,'그대의 삶이 새 생명의 기운으로 가득 차 있길!',633,NULL,NULL,NULL),(642,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',96,'고백은 지금은 조금 이르거나 부적절할 수 있어. 더 많은 시간이 필요할 거야.',641,NULL,NULL,NULL),(643,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',90,'지금은 고백하기에는 적절하지 않아. 더 많은 고민과 준비가 필요할 거야.',641,NULL,NULL,NULL),(644,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',148,'The Moon(Reverse)는 혼란스러운 감정과 불안함을 뜻해. Justice(Reverse)는 결정을 내리기 어려운 상황을 보여줘.',641,NULL,NULL,NULL),(645,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',135,'그러니까 지금은 고백하기에는 좋지 않을거야. 조금 더 시간을 가지고 상황을 파악해보는게 좋을거야.',641,NULL,NULL,NULL),(646,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',151,'과거의 상처로 인해 현재는 사랑에 대한 두려움과 망설임이 있어. 하지만 자신의 감정을 진심으로 표현한다면 좋은 결과를 얻을 수 있을 거야.',641,NULL,NULL,NULL),(647,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',67,'현재 상황에서는 사랑에 대한 만족과 행복이 느껴지지 않아. 하지만 곧 좋은 변화가 찾아올 거야. 그러니 지금은 참고 기다려봐.',641,NULL,NULL,NULL),(648,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',5,'고백은 지금은 적절하지 않아.',641,NULL,NULL,NULL),(649,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',89,'너의 마음을 잘못 이해할 수 있어, 좀 더 생각해봐야 해.',641,NULL,NULL,NULL),(650,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',24,'고백하기 전에 한번 더 생각해보는 건 어때?',641,NULL,NULL,NULL),(651,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',98,'그 사람에게 고백하기 전에 먼저 자신의 감정을 정리해보는 게 좋을 거야.',641,NULL,NULL,NULL),(652,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:44:04',8,'그대의 삶이 용기와 힘으로 가득 차 있길!',641,NULL,NULL,NULL),(666,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',14,'다양한 고민이 정리가 되는 시기가 될 걸세. 단, 과하면 독이요 적당하면 복이 올 거야.',665,NULL,NULL,NULL),(667,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',122,'남에게 잘 보이기 위해 거짓된 행동을 해서는 안 된다네. 이 시기에 이러한 행동은 자네에게 큰 독이 되어 돌아올 것이야.',665,NULL,NULL,NULL),(668,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',18,'고민거리가 많다면 요령껏 잘 피하는 게 좋을 거야. 그렇지 않으면 나중에 문제로 이어질 수 있는 안 좋은 시기라네.',665,NULL,NULL,NULL),(669,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',42,'포기하고 싶은 마음이 많이 들 수 있는 시기라네. 잠시 쉬면서 작은 변화를 준다면 극복할 수 있을 터이니 끝까지 힘내시게나.',665,NULL,NULL,NULL),(670,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',88,'말실수로 인해 큰 화를 입을 수 있으니 조심할 필요가 있다네. 앞서 행동하기보단 뒤에서 운명의 흐름에 자신을 맡기는 것도 현명한 선택이 될 것이야.',665,NULL,NULL,NULL),(671,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',81,'결정을 내릴 일이 있다면 이 시기에는 보류하는 것도 좋을 걸세. 또한 지각을 할 수 있으니 자명종을 잘 맞춰 두시게나.',665,NULL,NULL,NULL),(672,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',99,'지나침이 과하면 오히려 독이 될 수 있는 시기라네. 행운을 바라기 보단 사소한 것도 차근차근 신경 쓰며 나아가야 할 걸세.',665,NULL,NULL,NULL),(673,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',145,'새로운 일들을 하며 기분 전환하면 복이 있을 떄라네. 스스로 생각한 이상향이 있다면 이를 실현해보시게나.',665,NULL,NULL,NULL),(674,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',149,'그동안의 실패가 이제 성공을 향한 열쇠로 전환되는 시기라네. 좋은 기회가 많이 있을 것이니 새로운 마음으로 도전해보시게.',665,NULL,NULL,NULL),(675,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',48,'지식과 교양을 쌓으며 미래를 준비해보시게나. 이를 크게 도와줄 운이 함께 들어있는 시기라네.',665,NULL,NULL,NULL),(676,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',47,'꾸준한 노력이 원하는 결과로 나타나는 때가 되었다네. 인내력과 책임감이 꼭 필요하니 잊지 마시게나.',665,NULL,NULL,NULL),(677,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',151,'권태가 생겨 무슨 일하더라도 지루할 수 있겠네. 현실에서 억지를 부리지 말고 새로운 변화를 맞이하는 것이 좋아 보인다네.',665,NULL,NULL,NULL),(678,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 15:52:35',19,'그대의 삶이 따뜻한 빛과 기쁨으로 가득 차 있길!',665,NULL,NULL,NULL),(680,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',74,'이 사람에게 호감을 느끼지만, 조심해야 할 거야. 그 사람은 숨겨진 면이 있어서, 당신이 예상하지 못한 일이 일어날 수 있어.',679,NULL,NULL,NULL),(681,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',18,'그러나 그 사람과 함께하면 꿈을 이룰 수 있어. 당신과 그 사람은 서로에게 빛나는 별이 되어줄 거야.',679,NULL,NULL,NULL),(682,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',95,'이 사람에게 호감을 느끼지만, 조심해야 할 거야. 그 사람은 숨겨진 면이 있어서, 당신이 예상하지 못한 일이 일어날 수 있어.',679,NULL,NULL,NULL),(683,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',141,'그러나 그 사람과 함께하면 꿈을 이룰 수 있어. 당신과 그 사람은 서로에게 빛나는 별이 되어줄 거야.',679,NULL,NULL,NULL),(684,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',85,'사랑운과 관련된 결과는 Page of Cups와 The Moon이야.',679,NULL,NULL,NULL),(685,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',86,'Page of Cups는 새로운 사랑의 시작을 의미하고, The Moon은 불안정한 감정을 나타내니까 좋아해도 되지만 조심해야겠어.',679,NULL,NULL,NULL),(686,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',3,'이 사람에게 빠져도 괜찮아.',679,NULL,NULL,NULL),(687,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',53,'하지만 그의 진심을 파악하기 어려울 수 있어.',679,NULL,NULL,NULL),(688,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',87,'당신이 좋아하는 그 사람과의 관계는 불안정하며, 감정적인 충돌이 예상될 거야. 하지만 그것을 극복하면 보람있는 관계가 될 수 있어.',679,NULL,NULL,NULL),(689,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',82,'그러나 그 사람과의 관계는 현재 불안정하며, 당신 스스로도 자신의 감정을 잘 다스리지 못할 것 같아. 먼저 자신을 돌보고 감정을 정리하는 것이 중요할 거야.',679,NULL,NULL,NULL),(690,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 16:02:10',11,'그대의 삶이 화합과 정의로 가득 차 있길!',679,NULL,NULL,NULL),(704,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 17:51:18',38,'취업에 대한 열망이 강하지만, 현재는 어떤 이유에서인지 진전이 없어 고민이 많아. 하지만 당신의 노력과 열정이 결실을 맺을 것이며, 미래에는 성공적인 결과를 얻을 수 있을 거야.',703,NULL,NULL,NULL),(705,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 17:51:18',20,'현재 상황에서는 조금 불안정하고 불확실한 시기이지만, 조금만 더 참고 노력하면 당신의 능력과 역량이 인정받을 수 있을 거야. 또한, 새로운 기회가 다가올 것이니 기회를 잡아보는 건 어때?',703,NULL,NULL,NULL),(706,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 17:51:18',86,'취업에 대한 불안과 두려움이 당신을 괴롭힐 수 있어. 하지만 당신의 노력과 열정으로 인해 성공할 가능성이 높아.',703,NULL,NULL,NULL),(707,'kWlR3JzzTafyMiaiYcFNuusX8hr2','2023-05-18 17:51:18',41,'현재의 상황에서는 취업이 어려울 수 