1','2023-05-18 18:12:35',132,'이제는 짝사랑을 끝내고 그녀에게 진실된 마음을 전하면 좋을 거야.',799,NULL,NULL,NULL),(806,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:12:35',47,'고백해도 괜찮을 거야.',799,NULL,NULL,NULL),(807,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:12:35',25,'하지만 그녀와의 관계에 대한 불안이 당신을 괴롭힐 수 있어.',799,NULL,NULL,NULL),(808,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:12:35',79,'고백해도 괜찮을 거야. 하지만 그녀의 대답은 당신이 원하는 대로 나오지 않을 수 있어.',799,NULL,NULL,NULL),(809,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:12:35',87,'당신의 짝사랑에 대한 고백은 어려운 상황일 수 있지만, 그녀와의 관계는 성공적일 것이다.',799,NULL,NULL,NULL),(810,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:12:35',9,'그대의 삶이 평화와 진리로 가득 차 있길!',799,NULL,NULL,NULL),(812,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',37,'고백하기 전에 상황을 더 잘 파악해보는 게 좋을 거야.',811,NULL,NULL,NULL),(813,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',76,'지금은 고백하기보다는 상대방의 반응을 먼저 살펴보는 게 좋을 거야.',811,NULL,NULL,NULL),(814,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',15,'불안정한 상황에서 선택을 하고 있을 것이고, 그 선택이 예상치 못한 결과를 가져올 수도 있어. 그러니까 잘 생각하고 신중하게 결정하는 게 좋을 거야.',811,NULL,NULL,NULL),(815,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',16,'당신의 선택에 따라서 상황이 나아질 수도 있고, 악화될 수도 있어. 그러니까 자신의 감정을 충분히 고민하고, 상대방의 감정을 존중해야 해.',811,NULL,NULL,NULL),(816,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',132,'짝사랑 중인 여사친에게 고백해도 될까요?',811,NULL,NULL,NULL),(817,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',56,'Two of Pentacles: 상황이 계속 변화하고 있어서 결정하기 어려워. 하지만 당신의 선택에 따라 좋은 결과가 있을거야. Six of Swords: 어려운 상황을 벗어나 새로운 시작을 할 수 있어. 하지만 그 전에 자신의 감정을 잘 살피고 결정하자.',811,NULL,NULL,NULL),(818,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',122,'고백하면 상대방이 혼란스러워할 거야.',811,NULL,NULL,NULL),(819,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',33,'하지만 네 마음에 있는 감정을 숨기는 것보다는 솔직해지는 게 좋을 거야.',811,NULL,NULL,NULL),(820,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',80,'고백해도 괜찮을거야.',811,NULL,NULL,NULL),(821,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',141,'그러나 그녀는 현재 자신의 삶에 충실한 상태이므로, 그녀의 선택은 당신의 기대와는 다를 수 있어.',811,NULL,NULL,NULL),(822,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 18:18:23',4,'그대의 삶이 리더십과 안정으로 가득 차 있길!',811,NULL,NULL,NULL),(824,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',145,'짝사랑 중인 여사친에게 고백해도 될까?',823,NULL,NULL,NULL),(825,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',19,'Four of Swords - 쉬는 시간이 필요해. 너무 서두르지 말고 조금 더 생각해봐.',823,NULL,NULL,NULL),(826,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',53,'고백해도 괜찮아. 그러나 그녀는 당신의 감정에 대해 혼란스러울지도 모르니, 진심으로 대화하면서 서로의 마음을 이해하는 것이 중요해.',823,NULL,NULL,NULL),(827,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',127,'그녀는 당신의 마음에 대해 긍정적으로 생각하고 있어. 하지만 너무 서두르지 말고 천천히 가는 것이 좋을 거야.',823,NULL,NULL,NULL),(828,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',118,'고백하기 전에 잘 생각해봐야 할 거 같아.',823,NULL,NULL,NULL),(829,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',76,'짝사랑 중인 상대방이 너무나도 가까운 곳에 있음에도 불구하고 마음이 허전한 상태인 것 같아.',823,NULL,NULL,NULL),(830,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',42,'짝사랑 중인 여사친에게 고백해도 될 거야.',823,NULL,NULL,NULL),(831,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',147,'Four of Cups(Reverse) 카드는 새로운 기회를 받아들이기를 꺼리는 것을 나타내고, The Sun 카드는 긍정적인 결과와 행복을 의미해.',823,NULL,NULL,NULL),(832,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',79,'이 카드들을 보면 짝사랑 중인 여사친에게 고백하는 것은 현재 상황에서는 좋지 않을 거야. 너 자신의 감정을 먼저 정리하고 그녀의 감정을 존중하는 태도를 보여줘야 해.',823,NULL,NULL,NULL),(833,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',113,'그러나 미래에는 너희 사이에 밝은 미래가 기다리고 있어. 그러니까 지금은 참고 조용히 지내다가 시간이 지나면 다시 한 번 생각해보는 것이 좋을 거야.',823,NULL,NULL,NULL),(834,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:42:09',17,'그대의 삶이 희망과 안식으로 가득 차 있길!',823,NULL,NULL,NULL),(836,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',148,'호감이 있는 여사친에게 고백하기에는 아직 준비가 되지 않은 것 같아.',835,NULL,NULL,NULL),(837,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',54,'현재는 자신의 이익을 위해 상대방을 이용하고자 하는 욕심이 크고, 그 결과로 인해 상대방에게 상처를 줄 수 있어. 고민을 더 해보는 거야.',835,NULL,NULL,NULL),(838,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',35,'호감이 있는 여사친에게 고백하기에는 아직 준비가 되지 않은 것 같아. 하지만 이제부터 조금씩 더 자신감을 갖고 나아가면 좋은 결과를 얻을 수 있을 거야.',835,NULL,NULL,NULL),(839,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',30,'지금은 고백하기에는 조금 위험한 상황이야. 먼저 자신의 감정을 잘 살펴보고 상황을 더 잘 파악해봐야 해.',835,NULL,NULL,NULL),(840,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',89,'결정을 내리기에는 아직 이른 시기이며, 지금은 자신의 감정을 좀 더 자세히 파악해보는 것이 중요해.',835,NULL,NULL,NULL),(841,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',153,'그러나 호감이 있는 여사친과의 관계는 긍정적인 전망이 있어, 자신감을 가지고 다가가는 것이 좋을 거야.',835,NULL,NULL,NULL),(842,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',150,'고백하기 전에 자신의 마음을 먼저 정리해보는 게 좋을 거야.',835,NULL,NULL,NULL),(843,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',146,'그리고 만약 고백한다면 거절의 가능성이 있으니 신중하게 생각해봐야 할 거야.',835,NULL,NULL,NULL),(844,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',95,'고백하기 전에 자신의 마음을 더 잘 알아봐야 해.',835,NULL,NULL,NULL),(845,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',152,'그리고 상대방의 반응은 예상치 못한 일이 일어날 수 있어.',835,NULL,NULL,NULL),(846,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:43:59',8,'그대의 삶이 용기와 힘으로 가득 차 있길!',835,NULL,NULL,NULL),(848,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:45:16',63,'고백하기 전에 상황을 잘 살펴보는 게 좋겠어. 그리고 감정을 표현하는 것도 중요해.',847,NULL,NULL,NULL),(849,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:45:16',22,'호감이 서로 느껴지는 것 같아. 하지만 너의 행동이나 말투가 어색하다면 조금 더 시간을 가지고 친해지는 게 좋을 거야.',847,NULL,NULL,NULL),(850,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:45:16',122,'호감이 있는 여사친에게 고백해도 괜찮을 거야.',847,NULL,NULL,NULL),(851,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:45:16',37,'고백할 때는 자신감을 가지고 솔직하게 말해보는 게 좋을 거야.',847,NULL,NULL,NULL),(852,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:45:16',143,'호감은 있지만 상황이 복잡해 보인다거야. 고백하기 전에 상황을 좀 더 살피는 게 좋을 거야.',847,NULL,NULL,NULL),(853,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:45:16',51,'고백은 하지 않는 게 좋아. 현재 상황에서는 상대방이 당신의 감정을 받아들이기 어려울 거야.',847,NULL,NULL,NULL),(854,'2OnaAL7xm8RIzmtZhkqr8aElinp1','2023-05-18 21:45:16',75,'고백해도 괜찮아!',847,NULL,NULL,NULL),(855,'2OnaAL7xm8RIzm