5,NULL,NULL,NULL),(948,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:21:38',108,'지나치게 낙관적인 마음으로 현실을 바라보지 못할 수 있을 것이야. 우선순위를 정해 준비한 것을 모두 발휘할 수 있도록 노력해야 한다네.',945,NULL,NULL,NULL),(949,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:21:38',19,'즐기기만 해도 성공이 따라오는 좋은 시기야. 행운이 나에게 있다고 생각하며 원하던 그림을 완성해 나가시게나.',945,NULL,NULL,NULL),(950,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:21:38',117,'두 마리의 토끼를 모두 잡으려다 놓쳐버리는 운이 있다네. 이익을 위해 스스로 평판을 낮추는 행위는 반드시 삼가시게나.',945,NULL,NULL,NULL),(951,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:21:38',139,'성공을 향한 성급함이 생겨 주변과 불필요한 충돌이 생길 수 있다네. 억지를 부리지 않으며 바쁠수록 침착하게 돌아가야 할 것이야.',945,NULL,NULL,NULL),(952,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:21:38',6,'그대의 삶이 사랑과 즐거움으로 가득 차 있길!',945,NULL,NULL,NULL),(954,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:28:22',17,'칙칙이가 안양에 성공할 가능성은 높지 않아.',953,NULL,NULL,NULL),(955,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:28:22',56,'The Star 카드는 희망과 기대감을 상징하지만 Seven of Swords 카드는 속임수와 배반을 의미해 성공할 가능성이 적다는 것을 암시하고 있어.',953,NULL,NULL,NULL),(956,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:28:22',20,'성공할 가능성이 높아보이는 거야.',953,NULL,NULL,NULL),(957,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:28:22',144,'하지만 일부 어려움이 있을 수 있어.',953,NULL,NULL,NULL),(958,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:28:22',27,'성공할 가능성은 낮아보여.',953,NULL,NULL,NULL),(959,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:28:22',119,'하지만 포기하지 않고 노력하면 좋은 결과가 있을 거야.',953,NULL,NULL,NULL),(960,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:28:22',124,'칙칙이가 안양에 성공할 확률은 낮아.',953,NULL,NULL,NULL),(961,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:28:22',133,'Six of Swords(Reverse) 카드는 여행이나 이동에서 어려움을 나타내는데, 이번 주 토요일에 칙칙이가 안양에 오는 것은 좋은 선택은 아닐 거야. Queen of Wands(Reverse) 카드는 자신감이 부족하고 결정을 내리기 어려워하는 상황을 나타내는데, 칙칙이가 성공할 확률은 더욱 줄어들 거야.',953,NULL,NULL,NULL),(962,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:28:22',112,'칙칙이가 안양에 성공할 가능성은 낮아.',953,NULL,NULL,NULL),(963,'78bkXsjKviV3aywbswR1nAWNDdI3','2023-05-19 02:28:22',42,'그러나 노력하고 계속 노력하면 성공할 수 있어.',953,NUL